import 'bootstrap/dist/css/bootstrap.min.css';

import MyNav from './components/nav';

import './App.css';
import React from 'react'
import {BrowserRouter as Router, Route, Switch, Link, Redirect, Routes} from "react-router-dom";
import HomePage from "./pages/home";
import AboutMe from "./pages/aboutMe";
import Art from "./pages/artPortfolio";
import Contact from "./pages/contact";
import Tech from "./pages/techPortfolio";


function App() {
    let Component;
    switch(window.location){
        case "/":
            Component = App
            break
        case "/aboutMe":
            Component = AboutMe
            break
        case "/artPortfolio":
            Component = Art
            break
        case "/techPortfolio":
            Component = Tech
            break
        case "/contact":
            Component = Contact
            break
    }
  return(
      <>
      <MyNav/>
        <Router>
          <Routes>
              <Route index element={<HomePage />} />
              <Route path="/aboutMe" element={<AboutMe />} />
              <Route path="/artPortfolio" element={<Art />} />
              <Route path="/techPortfolio" element={<Tech />} />
              <Route path="/contact" element={<Contact />} />
          </Routes>
        </Router>
      </>
  )
}

export default App;
